// cost at most 1ms, already tried using DSP, no improvement
static void CalcAllowedDist(CoderInfo *coderInfo, PsyInfo *psyInfo,
                            float *xr, float *xmin, int quality)
{
  int sfb, start, end, l;
  const float globalthr = 132.0 / (float)quality;
  int last = coderInfo->lastx;
  int lastsb = 0;
  int *cb_offset = coderInfo->sfb_offset;
  int num_cb = coderInfo->nr_of_sfb;
  float avgenrg = coderInfo->avgenrg;

  for (sfb = 0; sfb < num_cb; sfb++)
  {
    if (last > cb_offset[sfb])
      lastsb = sfb;
  }

  for (sfb = 0; sfb < num_cb; sfb++)
  {
    float thr, tmp;
    float enrg = 0.0;

    start = cb_offset[sfb];
    end = cb_offset[sfb + 1];

    if (sfb > lastsb)
    {
      xmin[sfb] = 0;
      continue;
    }

    if (coderInfo->block_type != ONLY_SHORT_WINDOW)
    {
      float enmax = -1.0;
      float lmax;

      lmax = start;
//no improvement using DSP
      for (l = start; l < end; l++)
      {
    	if (enmax < (xr[l] * xr[l]))
    	{
    	  enmax = xr[l] * xr[l];
    	  lmax = l;
    	}
      }      

      start = lmax - 2;
      end = lmax + 3;
      if (start < 0)
	    start = 0;
      if (end > last)
	    end = last;
    }

    // add by wf, to prevent the hardfault, wf, 0427
    if(start < 0 || end > 2 * FRAME_LEN)
    {
        //printf("[%s]input error\r\n", __FUNCTION__);
        continue;
    }
    for (l = start; l < end; l++)
    {
      enrg += xr[l]*xr[l];
    }

    thr = enrg/((float)(end-start)*avgenrg);
#ifdef AAC_ACCURACY_EDIT
    thr = fastpow(thr, 0.1f*(lastsb-sfb)/lastsb + 0.3f);
#else
    thr = pow(thr, 0.1f*(lastsb-sfb)/lastsb + 0.3f);
#endif

    tmp = 1.0 - ((float)start / (float)last);
    tmp = tmp * tmp * tmp + 0.075;

    thr = 1.0 / (1.4*thr + tmp);

    xmin[sfb] = ((coderInfo->block_type == ONLY_SHORT_WINDOW) ? 0.65 : 1.12)
      * globalthr * thr;
  }
}
